import React, { useState } from 'react';

function Contact() {
    return (
        <div style={{ maxWidth: '400px', margin: 'auto', padding: '20px' }}>
            <h2 style={{ fontSize: '24px', fontWeight: 'bold', textAlign: 'center' }}>Contact Us</h2>
            <form style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
                {/* Name Field */}
                <label style={{ fontWeight: 'bold' }}>Name</label>
                <input
                    type="text"
                    style={{
                        width: '100%',
                        padding: '8px',
                        border: '1px solid #ccc',
                        borderRadius: '5px',
                    }}
                />

                {/* Email Field */}
                <label style={{ fontWeight: 'bold' }}>Email</label>
                <input
                    type="email"
                    style={{
                        width: '100%',
                        padding: '8px',
                        border: '1px solid #ccc',
                        borderRadius: '5px',
                    }}
                />

                {/* Message Field */}
                <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'flex-start' }}>
                    <label style={{ fontWeight: 'bold', marginBottom: '5px' }}>Message</label>
                    <textarea
                        rows="5"
                        style={{
                            width: '100%',
                            padding: '8px',
                            border: '1px solid #ccc',
                            borderRadius: '5px',
                            resize: 'vertical',
                        }}
                    />
                </div>

                {/* Submit Button */}
                <button
                    type="submit"
                    style={{
                        backgroundColor: '#1d4ed8',
                        color: 'white',
                        padding: '10px',
                        border: 'none',
                        borderRadius: '5px',
                        cursor: 'pointer',
                        marginTop: '10px',
                    }}
                >
                    Submit
                </button>
            </form>
        </div>
    );
}

export default ContactForm;
